import logo from '../../assets/logoagencia.svg';
import { useHistory } from 'react-router';
import { Link } from 'react-router-dom';
import { NavbarWrapper, Logo, LoginButton } from './style';
import UserContext from '../../contexts/UserContext';
import { useContext } from 'react';

export default function Navbar() {
  const { setToken, setIsLoggedInType, isLoggedInType } =
    useContext(UserContext);
  let history = useHistory();

  function goToHomeScreen() {
    history.push('/');
  }

  function exit() {
    setToken('');
    setIsLoggedInType('');
    history.push('/login');
  }

  return (
    <NavbarWrapper>
      <Logo src={logo} onClick={goToHomeScreen} />
      <Buttons>
        <LoginButton>
          <Link to="/login" style={{ textDecoration: 'none', color: 'white' }}>
            √Årea Administrativa
          </Link>
        </LoginButton>
        <ExitButton visible={isLoggedInType} onClick={exit} />
      </Buttons>
    </NavbarWrapper>
  );
}
